for key, (desc, a_flat, b_list) in huestrics.items():
    # build numeric A and b
    A = lower_triangle_from_flat(a_flat, s)
    b = np.array(b_list)

    # lift to Sympy
    A_sym    = sp.Matrix(A)
    b_sym    = sp.Matrix(b)
    I        = sp.eye(s)
    e        = sp.ones(s, 1)

    # compute the 1×1 matrix M = z * bᵀ * (I − zA)⁻¹ * e
    M        = z * b_sym.T * (I - z*A_sym).inv() * e

    # extract its single entry, add 1, simplify
    R_expr   = sp.simplify(M[0] + 1)

    # convert to a NumPy-callable
    R_fun    = sp.lambdify(z, R_expr, 'numpy')

    # set up a grid in the complex plane
    beta_ref = 72.36209223072636  # your reference radius
    x = np.linspace(-1.1*beta_ref, 0.1*beta_ref, 300)
    y = np.linspace(-0.5*beta_ref, 0.5*beta_ref, 300)
    X, Y = np.meshgrid(x, y)
    Z = X + 1j*Y

    # evaluate and plot the |R|=1 contour
    R_val = np.abs(R_fun(Z))

    plt.figure(figsize=(6,5))
    plt.contour(X, Y, R_val, levels=[1], colors='black')
    plt.title(f"Heuristic {key}: {desc}")
    plt.xlabel("Re(z)")
    plt.ylabel("Im(z)")
    plt.grid(True)
    plt.tight_layout()
    plt.show()


